import React from "react";
import ProgressBar from '../../components/ProgressBar';
import data from '../../assets/home/icons/Tours/date.svg';
import time from '../../assets/home/icons/Tours/time.svg';
import Tuscany from '../../DB/Tuscany.json';
import { useDispatch,useSelector } from "react-redux";



export default function BookingDetails () {
	const dispatch = useDispatch();
	const selectedTime = useSelector((state) => state.datepicker.selectedTime);
	const selectedDate = useSelector((state) => state.datepicker.selectedDate);
	
	const adultPrice = useSelector((state) => state.tour.adultPrice);
	const childPrice = useSelector((state) => state.tour.childPrice);
	const infantPrice = useSelector((state) => state.tour.infantPrice);
	
	const adultCost = useSelector((state) => state.tour.adultCost);
	const childCost = useSelector((state) => state.tour.childCost);
	const infantCost = useSelector((state) => state.tour.infantCost);
	
	const value = useSelector((state) => state.tour.value);
	const descrease = useSelector((state)=> state.tour.descrease);
	const increase = useSelector((state)=> state.tour.increase);


	

    return(
<section className="booking_container">
	{/* <ProgressBar/> */}
  	<section className="booking_main">

      <section className="booking_data" >
        <h2>When you will visit?</h2> 
				<section>             
					<img src={data} alt="choose a data"/>	<select> 
							<option>
								{selectedDate || 'Choose a date'}
							</option>
						</select>
					</section> 
      </section>
    
      <section className="booking_data" >
        <h2>Which time?</h2>
				<section>
					<img src={time} alt="choose a time"/>	<select>  
							<option>
								{selectedTime || 'Choose a time'}
							</option>
						</select>
				</section>
         </section>
      {/* style={{ backgroundColor: "#EFEFEF", opacity: 0.4 }} */}

			<section >
			<ul >
  			<h2>Select Your Tickets</h2>
  				<li>Free for kids under 6 and disabled visitors (74%+)</li>
  				<li>Pregnant women, families with strollers, and visitors on crutches can buy priority tickets at the venue</li>
			</ul>	
			</section>
			<section className="tickets_body">
{/*Adult */}
			<section className="tickets_order">
				<ul>
					<h2>Adult(18+)</h2>
					<h3>{adultPrice?? "Not available"}</h3>
				</ul>

				<section className="tickets_counter">
					<button  
						onClick={() => dispatch(descrease)}> - </button>

					<input
						type="number"
						value={value} 
						onChange={(e)=> value(e.target.value)}
					/>
					<button onClick={() => dispatch(increase())}> + </button>
					{/* <h6>Total Adult Cost: {adultCost}</h6>  */}
				</section> 
			</section>
{/*Child  */}
			<section className="tickets_order">
					<ul >
						<h2>Child (6-17)</h2>
							<li>With valid ID</li>
							<li>Only in combination with: Adult (18+)</li>
					</ul>

				{/* <section className="tickets_body"> */}

					<section className="tickets_order">
							<ul>
								{/* <h3>{specificTour.childPrice ?? "Not available"}</h3> */}
							</ul>
						<section className="tickets_counter">
							 <button  
							onClick={() => dispatch(descrease())}> - </button>
								<input
									type="number"
									value={value} 
									onChange={(e)=> value(e.target.value)}
								/>
							<button onClick={()=> dispatch(increase())}> + </button>
							{/* <h6>Total Child Cost: {childCost}</h6>  */}
						</section>
									{/*Infant */}
						
					</section>
					<section className="tickets_order">
							<ul>
								<h2>Infant (0-5) </h2>
								<li>Only in combination with: Adult (18+)</li>
							</ul>
							<section className="tickets_counter">
								 <button  
									onClick={() => dispatch(descrease())}>-</button>
								<input
									type="number"
									value={value} 
									// onChange={handleChange}
								/>
								<button onClick={()=> dispatch(increase())}>+</button>
								<h6>Total Infant Cost: {infantCost}</h6> 
							</section>
						</section>
					{/* </section>  */}
				</section>

      </section>
		</section>

</section>

    )
}
